import React from "react";
import s from "./Btn.module.css";
import $ from 'jquery';

const Btn = () => {
    $('#btn_click').on('click', function(e){
        e.preventDefault();
        $('html, body').animate({scrollTop: $($().attr('href')).offset().top}, 2000);
    });

    return <button className={s.arend}  id="btn_click">Заказать</button>;
};

export default Btn;
